import React from 'react';
import { ServHead } from './components/header';
import { NavLink } from 'react-router-dom';
import { Main } from './components';

export const Services = () => (
	<main>
		<ServHead />
		<Main>
			<div className="bg-black ba bw2">
				<div className="absolute white futura fw7 f1 pb1 pl1">FOTOGRAFIA</div>
				<img
					src="./img/slr.jpeg"
					alt="dslr"
					className="w-100 h-100"
					className="dark z0"
				/>
			</div>
		</Main>
	</main>
);
